/* eslint-disable import/no-duplicates */
import express from 'express'
import path from 'path'
import fs from 'fs'

import cors from 'cors'
import bodyParser from 'body-parser'
import sockjs from 'sockjs'
import faker from 'faker'
import cookieParser from 'cookie-parser'
import Html from '../client/html'
import Variables from '../client/variables'

const PAGE_SIZE = 10

let connections = [];
const clientVariables = Object.keys(process.env)
  .filter(key => key.indexOf('CLIENT') === 0)
  .reduce((res, key) => (Object.assign({}, res, { [key]: process.env[key] })), {});


const port = process.env.PORT || 3000;
const server = express();

server.use(cors());
// middleware
server.use(express.static(path.resolve(__dirname, '../dist/assets')));
server.use(bodyParser.urlencoded({ limit: '50mb', extended: true, parameterLimit: 50000 }))
server.use(bodyParser.json({ limit: '50mb', extended: true }))

server.use(cookieParser());

// server.use('/api/', (req, res) => {
//   res.status(404);
//   res.end();
// });

const echo = sockjs.createServer();
echo.on('connection', (conn) => {
  connections.push(conn);
  conn.on('data', async () => {});

  conn.on('close', () => {
    connections = connections.filter(c => c.readyState !== 3)
  });
});


server.get('/js/variables.js', (req, res) => {
  console.log('I am here')
  res.send(
    Variables({
      clientVariables
    })
  );
});

const getFakeUser = () => {
  return {
    name: faker.name.findName(),
    email: faker.internet.email(),
    company: faker.company.companyName(),
    salary: faker.finance.amount(),
    age: (faker.random.number() % 30) + 18,
    city: faker.address.city(),
    avatar: faker.image.avatar()
  }
}

const imgdata = [
  0x47, 0x49, 0x46, 0x38, 0x39, 0x61, 0x01, 0x00, 0x01, 0x00, 0x80, 0x00, 0x00, 0xFF, 0xFF, 0xFF,
  0x00, 0x00, 0x00, 0x21, 0xf9, 0x04, 0x04, 0x00, 0x00, 0x00, 0x00, 0x2c, 0x00, 0x00, 0x00, 0x00,
  0x01, 0x00, 0x01, 0x00, 0x00, 0x02, 0x02, 0x44, 0x01, 0x00, 0x3b
]
const imgbuf = Buffer.from(imgdata)
server.get('/tracker/:userId.gif', (req, res) => {
  const { userId } = req.params
  // <img src={`/tracker/${counter}.gif`} alt="tracker" />
  // '/tracker'
  const dataObj = {
    language: req.headers['accept-language'],
    userAgent: req.headers['user-agent'],
    date: +(new Date()),
    ipAddress: req.connection.remoteAddress,
    userId
  }
  const fileName = `${__dirname}/logs/${userId}_${dataObj.date}.json`;
  return fs.writeFile(
    fileName,
    JSON.stringify(dataObj),
    () => {
      res.writeHead(200, {
        'Content-Type': 'image/gif',
        'Content-Length': imgdata.length,
      })
      res.end(imgbuf)
    }
  )
})

server.get('/api/users/:pageIndex', (req, res) => {
  const { pageIndex } = req.params
  // const { pageTotal } = req.params
  const fileName = `${__dirname}/tmp/data.json`;
  fs.readFile(
    fileName,
    (err, data) => {
      if (!err) {
        return res.json(
          JSON.parse(data).slice(+pageIndex * PAGE_SIZE, (+pageIndex + 1) * PAGE_SIZE)
        )
      }
      const dataGenerated = new Array(100).fill(null).map(getFakeUser);
      return fs.writeFile(
        fileName,
        JSON.stringify(dataGenerated),
        () => {
          res.json(
            dataGenerated.slice(+pageIndex * PAGE_SIZE, (+pageIndex + 1) * PAGE_SIZE)
          )
        }
      )
    }
  )
})

server.get('/', (req, res) => {
  // const body = renderToString(<Root />);
  const title = 'Server side Rendering';
  res.send(
    Html({
      body: '',
      title,
      clientVariables
    })
  );
});

server.get('/*', (req, res) => {
  const initialState = {
    location: req.url
  }

  return res.send(
    Html({
      body: '',
      initialState,
      clientVariables
    })
  );
});


const app = server.listen(port);

echo.installHandlers(app, { prefix: '/ws' });

// eslint-disable-next-line no-console
console.log(`Serving at http://localhost:${port}`);

